import React, { Component } from "react";

export default class Name extends Component {
  constructor() {
    super();
    this.state = {
      name: ""
    };
  }

  getName = () => {
    let nameUser = prompt("What is your name ?");
    this.setState({
      name: nameUser
    });
  };

  componentDidMount() {
    this.getName();
  }
  render() {
    let timex = new Date().getHours();
    let pagi = timex > 0 && timex < 9 && timex >= 0 && timex < 9;
    let siang = timex >= 9 && timex < 16;
    let sore = timex >= 16 && timex < 18;
    let malam = timex >= 18 && timex < 24;

    console.log(pagi);

    const ibBlue = {
      display: "inline-block",
      color: "white",
      fontSize: "49px"
    };
    return (
      <div>
        <h1 style={ibBlue}>Welcome, {this.state.name}</h1>
      </div>
    );
  }
}
